<script>
var basic = new Datamap({
    element: document.getElementById("map"),
    geographyConfig: {
    popupOnHover: false,

  }
});
    var select=document.querySelector("#map svg g" );
   select.addEventListener('click',e => console.log(e.srcElement.classList[1]))
    var mapscroll=document.querySelector(".mapcontainer" );
     mapscroll.addEventListener('mousemove', (e) => {
  const t = e.currentTarget;
  const xx = Math.min(1, e.clientX / t.clientWidth);
  const yy = Math.min(1, e.clientY / t.clientHeight);
  mapscroll.scrollLeft = (t.scrollWidth - t.clientWidth) * xx;
  mapscroll.scrollTop = (t.scrollHeight - t.clientHeight) * yy;
});


</script>
